import React from 'react';
import styled from "styled-components";

const Container = styled("div")`
width: 705px;
height: 119px;
`;

const QuoteText = styled("h3")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 28px;
color: #2A2A2A;
padding-top:30px;
`;


const Quote = ({ quote }) => {
    return (
        <>
        <Container>
            <QuoteText>{quote}</QuoteText>
        </Container>


        </>
    );
}

export default Quote;
